    //   //     "<section class=\"py-24 bg-gray-100\" data-gjs-type=\"section\">\n        <div class=\"container mx-auto px-4\" data-gjs-type=\"block\">\n            <h2 class=\"text-4xl md:text-5xl font-bold text-center mb-8 text-gray-800\" data-gjs-tagName=\"h2\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h2\">\n                Get Involved: Join Our Creative Community\n            </h2>\n            <p class=\"text-lg md:text-xl text-gray-700 max-w-5xl mx-auto text-center mb-12\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                Infinitely Studio is more than a tool—it’s a community of creators pushing the boundaries of web design. Share your templates, contribute components, or join our forums to connect with others. Here’s how you can get involved and make your mark.\n            </p>\n            <div class=\"grid grid-cols-1 md:grid-cols-3 gap-8\" data-gjs-type=\"block\">\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <h3 class=\"text-xl font-semibold mb-4 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Share Your Templates</h3>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Created a stunning design? Share it with our community! Upload your templates to our hub and inspire others while gaining recognition for your work.\n                    </p>\n                </div>\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <h3 class=\"text-xl font-semibold mb-4 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Contribute Components</h3>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Developers, build custom components with GSAP or Petite Vue and share them in our library. Help others enhance their projects while showcasing your skills.\n                    </p>\n                </div>\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <h3 class=\"text-xl font-semibold mb-4 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Join Our Forums</h3>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Connect with creators worldwide in our forums. Share tips, ask questions, and collaborate on exciting projects with the Infinitely Studio community.\n                    </p>\n                </div>\n            </div>\n            <div class=\"text-center mt-12\" data-gjs-type=\"block\"><a href=\"#\" class=\"inline-block bg-blue-600 text-white font-semibold py-4 px-12 rounded-full hover:bg-blue-700 transition duration-300 text-lg\" data-gjs-type=\"link\" data-gjs-draggable=\"false\">\n                    Join Our Community\n                </a></div>\n        </div>\n    </section>",
    //   //     "<section class=\"py-24 bg-white\" data-gjs-type=\"section\">\n        <div class=\"container mx-auto px-4\" data-gjs-type=\"block\">\n            <h2 class=\"text-4xl md:text-5xl font-bold text-center mb-8 text-gray-800\" data-gjs-tagName=\"h2\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h2\">\n                Who Can Use Infinitely Studio?\n            </h2>\n            <p class=\"text-lg md:text-xl text-gray-700 max-w-5xl mx-auto text-center mb-12\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                Infinitely Studio is designed for everyone. Whether you’re a freelancer showcasing your work, a small business owner launching an online store, or a developer building a custom app, our platform adapts to your needs. Here are just a few ways creators are using Infinitely Studio to bring their ideas to life.\n            </p>\n            <div class=\"space-y-12\" data-gjs-type=\"block\">\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <h3 class=\"text-2xl font-semibold mb-4 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Freelance Designers</h3>\n                    <p class=\"text-gray-600 mb-4\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        As a freelance designer, you need a portfolio that stands out. With Infinitely Studio, you can create a stunning portfolio in hours, not days. Use our visual editor to design a unique layout, add 140+ interactions to make your work pop, and use Symbols to keep your navigation consistent across pages. The Fonts Manager lets you experiment with typography to match your personal brand, while Quick Preview ensures every detail is perfect.\n                    </p>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Plus, our Files Manager keeps your project assets organized, so you can focus on showcasing your creativity. Whether you’re a graphic designer, UX specialist, or photographer, Infinitely Studio helps you create a portfolio that wows clients and lands you more gigs.\n                    </p>\n                </div>\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <h3 class=\"text-2xl font-semibold mb-4 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Small Business Owners</h3>\n                    <p class=\"text-gray-600 mb-4\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Running a small business is demanding, and you don’t have time to learn coding. Infinitely Studio makes it easy to build an online presence that drives sales. Use Loop Builder to create dynamic product listings for your e-commerce store, add animations with our CSS Animation Builder to highlight promotions, and manage your assets with the Files Manager. Our real-time Front Preview ensures your site looks great on desktops and mobiles.\n                    </p>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        From bakeries to fitness studios, Infinitely Studio helps small businesses create professional websites that attract customers and showcase their unique offerings. Get online fast and grow your business with confidence.\n                    </p>\n                </div>\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <h3 class=\"text-2xl font-semibold mb-4 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Web Developers</h3>\n                    <p class=\"text-gray-600 mb-4\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Developers, Infinitely Studio is your dream toolkit. Write custom CSS and JavaScript in our integrated code editor, add GSAP-powered animations for cinematic effects, and build reactive apps with Petite Vue. Our optimization options let you minify files or combine them for lightning-fast performance, while the Loop Builder makes it easy to integrate dynamic data from APIs.\n                    </p>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Whether you’re building a client site, a personal project, or a startup MVP, Infinitely Studio gives you the tools to code efficiently and deliver exceptional results. Say goodbye to repetitive tasks and hello to a platform that matches your ambition.\n                    </p>\n                </div>\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <h3 class=\"text-2xl font-semibold mb-4 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Bloggers &amp; Content Creators</h3>\n                    <p class=\"text-gray-600 mb-4\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Share your stories with the world using Infinitely Studio. Our Loop Builder makes it easy to display blog posts or video content dynamically, while the visual editor lets you create a unique layout that reflects your personality. Add interactions to keep readers engaged, and use the Fonts Manager to craft a typography style that stands out.\n                    </p>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Whether you’re a travel blogger, a food vlogger, or a lifestyle influencer, Infinitely Studio helps you build a site that connects with your audience and grows your brand.\n                    </p>\n                </div>\n            </div>\n        </div>\n    </section>",
    //   //     "<section class=\"py-24 bg-gray-100\" data-gjs-type=\"section\" data-gjs-custom-name=\"Why Choose ?\">\n        <div class=\"container mx-auto px-4 text-center\" data-gjs-type=\"block\">\n            <h2 class=\"text-4xl md:text-5xl font-bold mb-8 text-gray-800\" data-gjs-tagName=\"h2\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h2\">\n                Why Choose Infinitely Studio?\n            </h2>\n            <p class=\"text-lg md:text-xl text-gray-700 max-w-5xl mx-auto mb-12\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                Infinitely Studio is built to empower creators at every level. We believe that web design should be accessible, flexible, and limitless. That’s why we’ve created a platform that combines the simplicity of drag-and-drop design with the power of advanced coding tools. Whether you’re a beginner building your first site or a developer crafting a complex app, Infinitely Studio grows with you. Here’s why creators around the world choose us:\n            </p>\n            <div class=\"space-y-8 max-w-4xl mx-auto\" data-gjs-type=\"block\">\n                <div class=\"inf-block\" data-gjs-type=\"block\">\n                    <h3 class=\"text-xl font-semibold mb-2 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Time-Saving Features</h3>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Reusable Symbols, one-click library installs, and real-time previews streamline your workflow, letting you focus on creativity rather than repetitive tasks.\n                    </p>\n                </div>\n                <div class=\"inf-block\" data-gjs-type=\"block\">\n                    <h3 class=\"text-xl font-semibold mb-2 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Dynamic &amp; Engaging</h3>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        With 140+ interactions, GSAP-powered animations, and Loop Builder, you can create websites that captivate visitors and keep them coming back for more.\n                    </p>\n                </div>\n                <div class=\"inf-block\" data-gjs-type=\"block\">\n                    <h3 class=\"text-xl font-semibold mb-2 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Scalable for All Projects</h3>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        Whether you’re building a one-page portfolio or a multi-page e-commerce platform, Infinitely Studio scales with your ambitions, offering tools for every project size.\n                    </p>\n                </div>\n                <div class=\"inf-block\" data-gjs-type=\"block\">\n                    <h3 class=\"text-xl font-semibold mb-2 text-gray-800\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Community-Driven Innovation</h3>\n                    <p class=\"text-gray-600\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        We listen to our users and constantly update Infinitely Studio with new features, ensuring you always have the latest tools to create cutting-edge websites. 💙\n                    </p>\n                </div>\n            </div><a href=\"#get-started\" class=\"inline-block bg-blue-600 text-white font-semibold py-4 px-12 rounded-full hover:bg-blue-700 transition duration-300 text-lg mt-12\" data-gjs-type=\"link\" data-gjs-draggable=\"false\">\n                Join the Infinitely Studio Community\n            </a>\n        </div>\n    </section>",
    //   //     "<section class=\"py-24 bg-white\" data-gjs-type=\"section\">\n        <div class=\"container mx-auto px-4\" data-gjs-type=\"block\">\n            <h2 class=\"text-4xl md:text-5xl font-bold text-center mb-8 text-gray-800\" data-gjs-tagName=\"h2\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h2\">\n                What Our Community Says\n            </h2>\n            <p class=\"text-lg md:text-xl text-gray-700 max-w-5xl mx-auto text-center mb-12\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                From freelancers to agencies, Infinitely Studio is transforming how people build websites. Our community of creators loves the flexibility, ease, and power of our platform. Here’s what they’re saying about their experience with Infinitely Studio.\n            </p>\n            <div class=\"grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8\" data-gjs-type=\"block\">\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <p class=\"text-gray-600 italic mb-4\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        “Infinitely Studio changed the way I build websites. As a graphic designer, I needed a tool that let me focus on visuals without learning code. The visual editor and 140+ interactions made my portfolio look incredible, and Symbols saved me so much time!”\n                    </p>\n                    <p class=\"text-gray-800 font-semibold\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">Sarah M., Freelance Graphic Designer</p>\n                </div>\n                <div class=\"bg-white p-8 rounded-lg shadow-lg\" data-gjs-type=\"block\">\n                    <p class=\"text-gray-600 italic mb-4\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                        “I run a small bakery, and Infinitely Studio helped me create an online store that looks