    //   //     "<footer class=\"bg-gray-800 text-white py-16\" data-gjs-tagName=\"footer\" data-gjs-draggable=\"false\" data-gjs-droppable=\"false\" data-gjs-tagname=\"footer\">\n        <div class=\"container mx-auto px-4 text-center\" data-gjs-type=\"block\">\n            <h3 class=\"text-3xl font-bold mb-6\" data-gjs-tagName=\"h3\" data-gjs-type=\"heading\" data-gjs-draggable=\"false\" data-gjs-droppable=\"true\" data-gjs-editable=\"true\" data-gjs-tagname=\"h3\">Infinitely Studio</h3>\n            <p class=\"text-lg mb-8 max-w-3xl mx-auto\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">\n                The website builder that grows with you. Create stunning, dynamic, and scalable websites with no code limits. Join our community and start building today. 💙\n            </p>\n            <p class=\"text-sm\" data-gjs-type=\"text\" data-gjs-draggable=\"false\">© 2025 Infinitely Studio. All rights reserved.</p>\n        </div>\n    </footer>"
